import React, { Component } from 'react'
import styled from 'styled-components'



const Container = styled.div`
width:100%;
justify-content:center;
align-items:center;
margin:0 auto;
height:100%;
background:var(--secondary-color);
z-index:1;
position:relative;


`
const ContainerInner = styled.div`
max-width:70%;
padding:0px 5% 5% 6%;
color:white;
line-height:20px;
`

const Heading = styled.h2`
color: var(--secondary-color);
margin: 0px;
text-align: center;
`


const Box = styled.div`
background:var(--Section-color);
`

class Events extends Component {

  render() {



    return (


        <Container id="Hobbies">
           <Box>
          <Heading className="headings">Events</Heading>
          <ContainerInner>
          <ul>
            <li>-	Birthday Parties </li>
            <li>-	Engagement Parties / Surprises </li>
            <li>-	Gala Dinners  </li>
            <li>-	Gender Reveals </li>
            <li>-	Baby Showers / Welcoming</li>
            <li>-	Bridal Parties </li>
            <li>-	Graduation Party </li>
            <li>-	Conferencing </li>
            <li>-	Launch Party etc. </li>
          </ul>
          </ContainerInner>
          </Box>

        </Container>

    );
  }
}
export default Events;
